    const emailVerified = user.emailVerified;
    const uid = user.uid;


    return (
        <div>
            <Table striped bordered hover variant="dark">
                <tbody>
                    <tr>
                    <td>1</td>
                    <td>{displayName}</td>
                    </tr>
                    <tr>
                    <td>2</td>
                    <td>{email}</td>
                    </tr>
                    <tr>
                    <td>3</td>
                    <td colSpan="2">{emailVerified}</td>
                    </tr>
                </tbody>
            </Table>
        </div>
    )
}

export default Profile
